import './styles/ConfirmedBooking.css';

function ConfirmedBooking({ formData }) {
    return (
        <div id={"ConfirmedBooking"}>
            <section className={"reservation"}>
                <h1>Reservation Confirmed</h1>

                <p>See you soon! </p>
                <p>{formData.date}</p>
                <p>{formData.time}</p>
                <p>{formData.guests}</p>
                <p>{formData.occasion}</p>
            </section>
        </div>
    );
}

export default ConfirmedBooking;
